    function calc() {
      document.getElementById("result").innerHTML = getResult();      
    }     

    function getResult() {
      const homework = input.split("\n").map(line => line.match(/\S/g).map(e => +e || e));
       
      return doHomework(homework, {"+": 1, "*": 1}) + ", " + doHomework(homework, {"+": 2, "*": 1});
    }    

    function doHomework(homework, priority) {
      return homework.reduce((a, e) => a + evaluate(getReversePolish(e, priority)), 0);
    }

    function evaluate(rpn) {
      const stack = [];

      rpn.forEach(e => {
        if (e == "+") {
          stack.push(stack.pop() + stack.pop());
        } else if (e == "*") {
          stack.push(stack.pop() * stack.pop());
        } else {
          stack.push(e);
        }
      });

      return stack[0];
    }

    function getReversePolish(expression, priority) {
      const rpn = [];
      const stack = [];

      expression.forEach(e => {
        if (e == "+" || e == "*") {
          if (priority[stack[stack.length - 1]] >= priority[e]) {
            rpn.push(stack.pop());                        
          } 
          stack.push(e);          

        } else if (e == "(") {
          stack.push(e);

        } else if (e == ")") {
          while (stack[stack.length - 1] != "(") {
            rpn.push(stack.pop()); 
          }
          stack.pop();    

        } else {
          rpn.push(e);
        }
      });
      
      rpn.push(...stack.reverse());       
      
      return rpn;
    }
